(17, 'Thủy lao thuật', 'Khi Hp giảm dưới 20% chiêu sẽ được tự động sử dụng với điệu kiện có đủ Mp, tăng cường phục hồi Hp đồng thời tăng thêm sức tấn công cho bản thân', 50, 3, 10, 6, 346),
