(40, 'Không thời gian thuật', 'Nhẫn thuật đặc biệt được thi triển bởi đôi mắt Mangekyou Sharingan, không có tác dụng với quái', 60, 4, 8, 0, 981);
INSERT INTO `task` (`id`, `name`, `levelNeed`, `idNpc`, `idMap`, `x`, `y`, `STR1`, `STR2`, `STR3`, `amountExp`, `amountVangKhoa`, `amountBac`, `amountBacKhoa`, `strItem`, `step`) VALUES
(0, 'Luyện tập', 1, 94, 75, 0, 0, 'Chào bà Konoha Utatane, nghe Konohamaru nói bà đang cần tìm con phải không?\n\\n94@Đúng rồi ta tìm con từ lúc sáng, mà giờ này mới gặp\n\\nDạ, tại con luyện tập ở sau rừng nên bà không tìm thấy\n\\n94@Con có luyện tập thật không đấy hay lại trốn đi ngủ?\n\\nHi hi ha ha\n\\n94@Thôi được rồi, con hãy đến bên kia đánh ngã vài con bù nhìn rơm, để ta xem con đã luyện tập như thế nào!\n\\n94@Con có muốn nhận nhiệm vụ này không?', 'Bà Konoha Utatane thấy con đánh thế nào? \\n94@Đường kiếm cũng tạm thôi, con luyện tập bấy lâu mà ta thấy vẫn không khá lên được', 'Ghi chú: Xoay nút đi góc dưới tay trái để di chuyển nhân vật', 600, 0, 0, 200, '12@True@-1@50@0@0@', '[{\"id\":16,\"name\":\"Sử dụng vũ khí\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":75,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":43,\"name\":\"Học cách cấu hình tự động\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Đánh ngã bù nhìn rơm\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":153,\"idMap\":75,\"x\":900,\"y\":373,\"require\":5,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(1, 'Bắt cừu về', 2, 94, 75, 0, 0, '94@Chuyện là như vầy, bầy cừu của ta đã đi lạc từ sáng đến giờ vẫn chưa về \\nCó phải mấy con cừu con không ạ? \\n94@Đúng rồi, chúng nó rất ham chơi mãi không chịu về \\n94@Con hãy dẫn chúng về đây cho ta, rồi ta sẽ có thưởng', '94@Bây cừu của ta, cuối cùng cũng chịu về rồi!!!', '', 1100, 0, 0, 400, '17@True@-1@50@0@0@', '[{\"id\":1,\"name\":\"Bắt cừu con\",\"idItem\":378,\"idNpc\":-1,\"idMob\":154,\"idMap\":75,\"x\":540,\"y\":146,\"require\":10,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(2, 'Hái thuốc trị thương', 4, 94, 75, 0, 0, '94@Không xong rồi, có 2 con cừu đã bị gãy chân, chắc là lúc sáng chúng đùa giỡn nên té bị thương\r\\n(Nghĩ thầm: Có khi nào do lúc nãy mình đánh mạnh tay ko ta...)\r\\n94@Con đang suy nghĩ gì thế #?\r\\nDạ không có gì... Bây giờ phải làm thế nào hả bà Konoha Utatane?\r\\n94@Con hãy đến kia hái cho ta vài cây thược dược, ta sẽ băng bó vết thương cho chúng\r\\n94@Con có nhận nhiệm vụ này không?', '94@Hãy mau đưa cây thược dược cho ta', '', 2000, 0, 0, 600, '13@True@-1@100@0@0@', '[{\"id\":2,\"name\":\"Hái cây thược dược\",\"idItem\":194,\"idNpc\":-1,\"idMob\":143,\"idMap\":75,\"x\":1017,\"y\":259,\"require\":3,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(3, 'Làm người tốt bụng', 5, 99, 75, 0, 0, 'Chị Anko ơi em đói bụng quá\r\\n99@Ở đây có rất nhiều món ngon, em muốn ăn gì?\r\\nChà chà, món nào cũng ngon cả, biết ăn gì bây giờ!!!\r\\nMà em còn rất ít tiền, sợ không đủ tiền trả\r\\n99@Nếu vậy, em xem có món nào phù hợp túi tiền thì hãy mua, đừng ăn quịt là được', '99@Em làm tốt lắm, vậy là không cần lo thiếu thức ăn để bán cho khách nữa rồi. Đưa rắn tím đây rồi chị sẽ có phần thưởng dành cho em', '', 4000, 0, 0, 800, '18@True@-1@100@0@0@', '[{\"id\":19,\"name\":\"Mua thức ăn mì xào\",\"idItem\":22,\"idNpc\":99,\"idMob\":-1,\"idMap\":75,\"x\":1074,\"y\":147,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":20,\"name\":\"Sử dụng mì xào\",\"idItem\":22,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Anko\",\"idItem\":-1,\"idNpc\":99,\"idMob\":-1,\"idMap\":75,\"x\":1074,\"y\":147,\"require\":1,\"STR\":\"Chà chà, thức ăn ngon tuyệt. Em ăn no rồi, chị Anko có việc gì cần nhờ em làm không? \\\\n99@Lương thực dự trữ trong quán cũng gần hết, em hãy giúp chị đi đến khu vực bên cạnh bắt 1 ít rắn tím về làm lương thực dữ trữ \\\\nVâng em sẽ đi ngay\",\"STR_ITEM\":\"\"},{\"id\":1,\"name\":\"Bắt rắn tím\",\"idItem\":379,\"idNpc\":-1,\"idMob\":155,\"idMap\":82,\"x\":237,\"y\":390,\"require\":3,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(4, 'Tìm Udon', 6, 3, 75, 0, 0, '3@^ sao rồi, bà Konoha Utatane tìm ~ có việc gì không?\r\\nTa tưởng có việc gì quan trọng để làm, nào ngờ chỉ là những chuyện lặt vặt\r\\n3@À ra là thế, em có việc quan trong nhờ ~ làm nè\r\\nViệc gì, mau nói đi\r\\n3@Udon, bạn thân của em đi lạc ở trong rừng, giờ này vẫn chưa về, ~ dẫn cậu ấy về giúp em\r\\nHaizz, việc này mà quan trọng đó hả?\r\\n3@Hi hi hi\r\\nThôi được rồi, để ~ tìm giúp cho\r\\n3@^ ráng giúp dùm em?', '3@^ thật tuyệt, em có phần thưởng cho ~ đây', 'Ghi chú: Giữ khoảng cách, đừng đi quá xa Udon trong lúc dẫn về', 7000, 0, 0, 1000, '4@True@-1@1@0@0@', '[{\"id\":5,\"name\":\"Tìm Udon\",\"idItem\":-1,\"idNpc\":2,\"idMob\":-1,\"idMap\":82,\"x\":1010,\"y\":119,\"require\":1,\"STR\":\"2@Gặp được ~ hay quá \\\\nUdon, em đi đâu sao giờ này vẫn chưa chịu về \\\\n2@Lúc sáng em bị thú hoang rượt đuổi, chạy thẳng vào rừng sâu, giờ không biết đường về nhà, huhu \\\\nCó ~ ở đây em đừng sợ, để ~ đưa em về\",\"STR_ITEM\":\"\"},{\"id\":7,\"name\":\"Dẫn Udon về\",\"idItem\":-1,\"idNpc\":2,\"idMob\":221,\"idMap\":82,\"x\":1010,\"y\":119,\"require\":1,\"STR\":\"Về nhà thôi\",\"STR_ITEM\":\"{1043,118}, {1043,118}, {839,114}, {680,114}, {613,239}, {501,313}, {599,459}, {441,552}, {295,507}, {191,507}, {87,507}\"}]'),
(5, 'Xua đuổi dơi rừng', 7, 94, 75, 0, 0, 'Bà Konoha Utatane, lại có việc cần tìm con sao?\r\\n94@Mùa này dơi rừng sinh sản rất nhiều, ta lo sợ chúng sẽ gây ảnh hưởng tới hoa màu của dân làng\r\\nCó phải bà muốn con tiêu diệt hết số dơi đó không?\r\\n94@Con hãy đuổi chúng ra khỏi khu vực của dân làng là được, đừng tàn sát sinh linh vô tội\r\\n(Nghĩ thầm: Ha ha lại có dịp để đánh đã tay rồi)\r\\n94@Con có nhận nhiệm vụ này không?', 'Bà Konoha Utatane, con đã hoàn thành nhiệm vụ \\n94@Trời ạ, ta đã nói là đừng tàn sát sinh linh vô tội mà \\nDạ, tại con lỡ tay xin bà đừng giận \\n94@Thôi dù sao cũng lỡ rồi, chỉ tội cho lũ dơi', '', 12000, 0, 0, 2000, '267@True@-1@1@0@0@', '[{\"id\":0,\"name\":\"Đuổi dơi rừng\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":156,\"idMap\":82,\"x\":785,\"y\":485,\"require\":15,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(6, 'Cảnh báo dân làng', 8, 94, 75, 0, 0, 'Bà Konoha Utatane, còn nhiệm vụ nào cần con làm nữa không?\r\\n94@Ở trong thung lũng tận cùng, có những hố sâu rất nguy hiểm...\r\\nNhiệm vụ càng nguy hiểm con càng thích, bà nói nhanh lên đi\r\\n94@Ta muốn con đem theo những cây cờ này, và cắm trước những hố sâu đó để cảnh báo cho người dân không bị rơi xuống hố mất mạng oan uổng\r\\n94@Con có nhận nhiệm vụ này không?', '94@Con làm việc rất tốt, ta có lời khen tặng', '', 19000, 0, 0, 3000, '185@True@-1@1@0@0@', '[{\"id\":3,\"name\":\"Cắm cờ vị trí 1\",\"idItem\":380,\"idNpc\":-1,\"idMob\":-1,\"idMap\":83,\"x\":424,\"y\":560,\"require\":1,\"STR\":\"Đang cắm cờ cảnh báo\",\"STR_ITEM\":\"\"},{\"id\":3,\"name\":\"Cắm cờ vị trí 2\",\"idItem\":380,\"idNpc\":-1,\"idMob\":-1,\"idMap\":83,\"x\":159,\"y\":396,\"require\":1,\"STR\":\"Đang cắm cờ cảnh báo\",\"STR_ITEM\":\"\"},{\"id\":3,\"name\":\"Cắm cờ vị trí 3\",\"idItem\":380,\"idNpc\":-1,\"idMob\":-1,\"idMap\":83,\"x\":843,\"y\":187,\"require\":1,\"STR\":\"Đang cắm cờ cảnh báo\",\"STR_ITEM\":\"\"}]'),
(7, 'Xua đuổi hầu tử', 9, 94, 75, 0, 0, '94@Vẫn chưa hết đâu, lũ khỉ nơi đó rất hung dữ, ta lo sợ chúng sẽ tấn công dân làng\r\\nVâng, vừa rồi con cắm cờ ở đó cũng bị chúng tấn công\r\\n94@Con hãy đến đó tìm cách xua đuổi chúng, ngăn chặn trước khi có chuyện đáng tiếc xảy ra\r\\n94@Con có nhận nhiệm vụ này không?', '94@Khá lắm, con làm việc ta rất hài lòng \\nCảm ơn bà Konoha Utatane đã khen tặng \\n94@Ta có phần thưởng dành cho con', '', 28000, 0, 0, 4000, '94@True@-1@1@3@4@0,100,110;1,100,110;10,25,30;17,60,60', '[{\"id\":0,\"name\":\"Đuổi khỉ\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":157,\"idMap\":83,\"x\":568,\"y\":730,\"require\":20,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(8, 'Nhẫn Giả học viên', 10, 94, 75, 0, 0, '94@Thời gian trôi qua nhanh thật, mới đây con đã đủ tuổi để trở thành một Nhẫn Giả rồi\r\\nBà Konoha Utatane nói gì, con nghe chưa rõ\r\\n94@Trường Konoha đang mở lớp tuyển học viên, ta nghĩ đã đến lúc con cần một người thầy thực sự\r\\nThật tuyệt, vậy là con sẽ trở thành một Nhẫn Giả, ola ola\r\\n94@Ngôi trường cách đây cũng không xa lắm, con hãy mau đi đến đó và chọn cho mình một người thầy thích hợp. Trước khi đi, con nhớ từ biệt mọi người trong làng rồi hãy lên đường', '94@Bây giờ con đã trở thành một Nhẫn Giả thực thụ, con phải siêng năng luyện tập để hoàn thành nhiệm vụ được giao, đừng phụ lòng mong mỏi của ta \\nDạ vâng, con sẽ cố gắng, bà Konoha Utatane hãy cứ yên tâm', '', 30000, 0, 0, 5000, '119@True@-1@1@5@4@0,100,110;1,100,110;7,25,30;27,3,3', '[{\"id\":5,\"name\":\"Từ biệt Konohamaru\",\"idItem\":-1,\"idNpc\":3,\"idMob\":-1,\"idMap\":75,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"3@Vậy là % sẽ trở thành một Nhẫn Giả\\r\\\\nEm cũng biết chuyện này rồi sao\\r\\\\n3@Em đã nghe bà Konoha Utatane nói. Sau này em cũng muốn được như ~, trở thành một học viên Nhẫn Giả của trường Konoha Gakuen\\r\\\\nChắn chắn vậy rồi, thời gian không còn sớm nữa ~ phải lên đường đây\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Từ biệt Anko Mitarashi\",\"idItem\":-1,\"idNpc\":99,\"idMob\":-1,\"idMap\":75,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Chị Anko, em ghé qua để tạm biệt chị vì em chuẩn bị đến trường Konoha Gakuen để trở thành một học viên Nhẫn Giả\\r\\\\n99@Chị cũng có nghe bà Konoha Utatane nói, em đi đường cẩn thận, nếu cần có thể mua ít thức ăn để mang theo\\r\\\\nSau này không biết còn có cơ hội được ăn thức ăn của chị nữa không\\r\\\\n99@Em quên rồi sao, chị còn có rất nhiều quán ăn nơi khác, em vẫn có thể ghé ăn mà\\r\\\\nPhải rồi, vậy mà em quên mất (cười lớn haha). Thời gian không còn sớm em phải lên đường đây\",\"STR_ITEM\":\"\"},{\"id\":9,\"name\":\"Đến trường Konoha Gakuen\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm hiểu lớp kiếm\",\"idItem\":-1,\"idNpc\":4,\"idMob\":-1,\"idMap\":86,\"x\":2461,\"y\":965,\"require\":1,\"STR\":\"4@Ta là thầy Hatake Kakashi. Kiếm là một trong những loại vũ khí mạnh nhất của Nhẫn Giả, đường kiếm nhanh gọn sẽ làm đối phương không kịp trở tay\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm hiểu lớp ám khí\",\"idItem\":-1,\"idNpc\":7,\"idMob\":-1,\"idMap\":86,\"x\":466,\"y\":1320,\"require\":1,\"STR\":\"7@Ta là thầy Asuma Sarutobi. Ám khí có kích thước nhỏ gọn, rất dễ mang theo bên mình, chỉ cần một sơ hở cũng có thể đẩy đối phương vào tình thế nguy hiểm\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm hiểu lớp gậy\",\"idItem\":-1,\"idNpc\":6,\"idMob\":-1,\"idMap\":86,\"x\":1113,\"y\":1441,\"require\":1,\"STR\":\"6@Ta là cô Kurenai Yuhi. Gậy tuy là một loại vũ khí thô sơ, nhưng nếu biết cách sử dụng bất cứ khi nào cũng có thể đoạt mạng được đối phương\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm hiểu lớp đao\",\"idItem\":-1,\"idNpc\":8,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"8@Ta là thầy Maito Gai. Đao tuy là một vũ khí khó sử dụng, nhưng một khi đã thuần thục thì không có gì có thể ngăn cản được\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm hiểu lớp dao găm\",\"idItem\":-1,\"idNpc\":5,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"5@Ta là thầy Umino Iruka. Dao ngắn rất để mang theo bên mình, xuất chiêu nhanh lẹ, đối phương chỉ kịp nhìn mà không thể làm gì được\",\"STR_ITEM\":\"\"},{\"id\":17,\"name\":\"Xin nhập học\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"%@Hiện # đã là học viên của lớp $ \\\\n%@Ta sẽ truyền dạy tất cả chiêu thức của lớp $ cho em. Trước tiên em hãy mở túi và sử dụng vũ khí mà ta vừa tặng \\\\nVâng, em xin tuân lệnh _\",\"STR_ITEM\":\"\"},{\"id\":16,\"name\":\"Sử dụng vũ khí\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":21,\"name\":\"Tăng điểm tiềm năng\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":22,\"name\":\"Tăng điểm chiêu thức\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(9, 'Nhiệm vụ đầu tiên', 10, 28, 86, 0, 0, 'Chào ông, cho con hỏi ông có phải là Sarutobi Hiruzen?\r\\n28@Đúng vậy, ta chính là Hokage Đệ Tam và cũng là thợ rèn luyện binh khí cho các cư dân trong làng\r\\nCon đến đây để xin nhận nhiệm vụ\r\\n28@Ta đã có nghe nói con chính là học viên mới của trường Konoha Gakuen, chắc con vẫn còn xa lạ với mọi người ở đây\r\\n28@Con hãy đi xung quanh làm quen với mọi người, đây là nhiệm vụ đầu tiên ta giao cho con?', '28@Tốt lắm, ta có phần thưởng cho con đây', '', 35000, 0, 0, 6000, '84@True@-1@1@5@4@0,100,110;1,100,110;7,25,30;26,3,3', '[{\"id\":5,\"name\":\"Làm quen Kinkaku\",\"idItem\":-1,\"idNpc\":97,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"97@Xin chào, ta là Kinkaku, công việc của ta là giúp lưu thông tiền tệ cho các cư dân trong làng, khi nào cần đổi bạc hoặc bạc khóa thì cứ tới đây tìm ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quen Ginkaku\",\"idItem\":-1,\"idNpc\":21,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"21@Xin chào, ta là Ginkaku, công việc của ta là thưởng phúc lợi cho các học viên Nhẫn Giả, khi nào cần nhận thưởng thì cứ tới đây tìm ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quenTobirama\",\"idItem\":-1,\"idNpc\":92,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"92@Xin chào, ta là Senju Tobirama \\\\n92@Ta chính là Hokage Đệ Nhị và cũng là người chuyên bán các loại áo choàng cho học viên Nhẫn Giả, khi nào cần mua áo choàng thì cứ đến đây gặp ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quen Kamizuki\",\"idItem\":-1,\"idNpc\":29,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"29@Xin chào, ta là Kamizuki, ta chuyên bán các loại trang phục cho học viên Nhẫn Giả, khi nào cần mua trang phục thì cứ đến đây gặp ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quen Morino\",\"idItem\":-1,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"96@Xin chào, ta là Morino, ta bán binh khí các loại, khi nào cần mua binh khí thì cứ đến đây gặp ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quen Kotetsu\",\"idItem\":-1,\"idNpc\":91,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"91@Xin chào, ta là Kotetsu, ta chuyên bán các loại phụ kiện mang theo bên mình của học viên Nhẫn Giả, khi nào cần mua phụ kiện thì cứ đến đây gặp ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quen Ebisu\",\"idItem\":-1,\"idNpc\":101,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"101@Xin chào, ta là Ebisu, ta có thể dẫn mọi người nhanh chóng đến các làng và quay về trường, khi nào cần đi gấp thì cứ đến đây gặp ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Làm quen Jiraiya\",\"idItem\":-1,\"idNpc\":31,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"31@Xin chào, ta là Jiraiya, mọi người thường gọi ta là Tiên Nhân Cóc. Ở đây ta chuyên bán các trang bị Hokage cho các học viên Nhẫn Giả, khi nào cần mua trang bị Hokage thì cứ đến đây gặp ta\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Sarutobi Hiruzen\",\"idItem\":-1,\"idNpc\":28,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"28@Thế nào rồi, con đã làm quen với tất cả mọi người chưa?\\r\\\\nDạ, con đã làm quen và biết hết từng công việc của mọi người rồi\\r\\\\n28@Tốt lắm, tiếp theo ta sẽ chỉ cho con cách rèn luyện binh khí trở nên mạnh mẽ hơn, con hãy đi đến khu vực bên cạnh tìm vài viên đá mang về đây\\r\\\\nVâng, con sẽ đi làm ngay\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Đánh khỉ tìm đá\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":157,\"idMap\":83,\"x\":977,\"y\":730,\"require\":30,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":15,\"name\":\"Cường hóa vũ khí\",\"idItem\":-1,\"idNpc\":28,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(10, 'Trợ giúp Làng Sương Mù', 11, 58, 60, 0, 0, 'Xin chào ông Byakuren\r\\n58@Con là ai, đến đây tìm ta có việc gì?\r\\nCon là #, là học viên Nhẫn Giả đến từ trường Konoha Gakuen, con được cử đến đây để trợ giúp Làng Sương Mù\r\\n58@Ra là thế, ta cũng đang có việc cần người giúp đỡ đây, nhưng trước tiên con hãy đến bên người giữ rương xin cư trú lại nơi này để thuận tiện làm nhiệm vụ\r\\n58@Con có muốn nhận nhiệm vụ này không?', '58@Ta thật không ngờ con lại hoàn thành nhiệm vụ nhanh đến như vậy', '', 40000, 0, 0, 7000, '114@True@-1@1@3@4@0,100,110;1,100,110;10,25,30;27,3,3', '[{\"id\":23,\"name\":\"Ở lại làng sương mù\",\"idItem\":-1,\"idNpc\":47,\"idMob\":-1,\"idMap\":60,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Byakuren\",\"idItem\":-1,\"idNpc\":58,\"idMob\":-1,\"idMap\":60,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Con đã xin Karui ở lại nơi này, bây giờ ông Byakuren có cần con giúp đỡ gì không? \\\\n58@Khu vực bên cạnh ta có nuôi 1 số ếch xanh, đang đến mùa thu hoạch, con hãy đi thu hoạch giúp ta \\\\nVâng con sẽ đi làm ngay\",\"STR_ITEM\":\"\"},{\"id\":1,\"name\":\"Bắt ếch xanh\",\"idItem\":381,\"idNpc\":-1,\"idMob\":158,\"idMap\":62,\"x\":196,\"y\":801,\"require\":5,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(11, 'Bắt kẻ nghe lén', 12, 58, 60, 0, 0, '58@Gần đây xuất hiện rất nhiều chim hắc điểu xung quanh ngôi làng\r\\nChim hắc điểu thì có vấn đề gì, ông Byakuren?\r\\n58@Ta nghi ngờ đây chính là chim do thám của anh em nhà Zabuza\r\\nZabuza là ai vậy ông Byakuren?\r\\n58@Zabuza được mệnh danh là con quỷ của làng sương mù, thời gian gần đây hắn đang có ý đồ xấu với làng của ta\r\\nVậy bây giờ chúng ta cần làm gì, ông Byakuren?\r\\n58@Con hãy mang theo vài cái bẫy chim và bắt vài con chim hắc điểu mang về đây, ta cần tìm hiểu kỹ về loài chim này\r\\n58@Con có muốn nhận nhiệm vụ này không?', '58@Con làm việc rất tốt, ta có lời khen ngợi', '', 62881, 5, 0, 8000, '74@True@-1@1@1@4@0,100,110;1,100,110;8,25,30;26,3,3', '[{\"id\":12,\"name\":\"Đặt bẫy chim\",\"idItem\":383,\"idNpc\":-1,\"idMob\":-1,\"idMap\":62,\"x\":1080,\"y\":257,\"require\":1,\"STR\":\"Đang đặt bẫy\",\"STR_ITEM\":\"382\"},{\"id\":12,\"name\":\"Đặt bẫy chim\",\"idItem\":383,\"idNpc\":-1,\"idMob\":-1,\"idMap\":62,\"x\":925,\"y\":586,\"require\":1,\"STR\":\"Đang đặt bẫy\",\"STR_ITEM\":\"384\"},{\"id\":12,\"name\":\"Đặt bẫy chim\",\"idItem\":383,\"idNpc\":-1,\"idMob\":-1,\"idMap\":62,\"x\":1535,\"y\":801,\"require\":1,\"STR\":\"Đang đặt bẫy\",\"STR_ITEM\":\"385\"},{\"id\":5,\"name\":\"Nói chuyện với Byakuren\",\"idItem\":-1,\"idNpc\":58,\"idMob\":-1,\"idMap\":60,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"58@Quả nhiên đây là loại chim do thám, cũng may mà chúng ta phát hiện kịp thời nếu không hậu quả sẽ rất khó lường\\r\\\\nBước tiếp theo chúng ta sẽ làm gì, ông Byakuren?\\r\\\\n58@Trước mắt con hãy ra ngoài tiêu diệt hết số chim còn lại, ta sẽ tìm cách đối phó sau\\r\\\\nVâng, con sẽ đi làm ngay\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Tiêu diệt chim hắc điểu\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":159,\"idMap\":62,\"x\":1241,\"y\":417,\"require\":20,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(12, 'Kẻ địch lộ diện', 13, 58, 60, 0, 0, '58@Ta nghe người dân trong làng tình báo, đồng bọn của Zabuza đã xuất hiện ở hẻm núi Hẻm Núi Mizu\r\\nTin này có chính xác không, ông Byakuren?\r\\n58@Nguồn tin cũng rất đáng tin cậy, tuy nhiên ta muốn con đến đó để xem thực hư thế nào, rồi về đây báo lại cho ta biết\r\\n58@Con có muốn nhận nhiệm vụ này không?', '58@Thế nào rồi, con có dò la được tung tích gì không?\r\\nĐúng như lời ông Byakuren nói, đồng bọn của Zabuza là Haku, bọn chúng đang âm mưu phá hoại ngôi làng\r\\nCon đã giao đấu với Haku, rất tiếc là đã để cho hắn trốn thoát rồi\r\\n58@Con đã làm rất tốt, ta có lời khen ngợi', '', 90274, 2, 0, 9000, '109@True@-1@1@5@4@0,100,110;1,100,110;7,25,30;27,3,3', '[{\"id\":5,\"name\":\"Nói chuyện với Haku\",\"idItem\":-1,\"idNpc\":40,\"idMob\":-1,\"idMap\":66,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Cô nương, xin cho hỏi, cô có nhìn thấy Zabuza và đồng của bọn chúng ở đâu không?\\r\\\\n40@Ơ, Zabuza và đồng bọn là những người như thế nào, \\u0026 có thể nói rõ hơn không?\\r\\\\n(Nghĩ thầm) Thôi chết, lúc nãy mình đi gấp quá mà quên hỏi ông Byakuren, về hình dáng của bọn chúng như thế nào\\r\\\\nBọn đều là những người xấu, bọn chúng đang tìm cách tấn công Làng Sương Mù, tôi đến đây để ngăn chặn âm mưu của bọn chúng\\r\\\\n40@Thật không ngờ, một đứa trẻ như \\u0026 lại rất có lòng dũng cảm, nhưng ta nghĩ nếu thật sự như vậy thì \\u0026 không đủ sức chống lại bọn chúng đâu\\r\\\\nCô đừng xem thường tôi, tuy nhỏ tuổi nhưng tôi chính là học viên Nhẫn Giả của trường Konoha Gakuen, võ công cũng không tệ đâu\\r\\\\nMà 1 mình cô, tại sao lại ở nơi hẻo lánh này (bắt đầu cảm thấy nghi ngờ)\\r\\\\n40@Ta cùng anh trai đến đây để hái thuốc\\r\\\\nNếu vậy, anh trai của cô đâu rồi\\r\\\\n40@...\\r\\\\nKhông trả lời được, không lẽ cô cũng có liên quan đến bọn Zabuza\\r\\\\n40@Hahaha, bị ngươi lật tẩy rồi, nếu đã thế ta cũng không ngại cho ngươi biết ta chính là Haku và Zabuza chính là đại ca của ta\\r\\\\nĐúng như ta nghi ngờ, các ngươi đến đây để tấn công làng sương mù đúng không?\\r\\\\n40@Nếu đúng như vậy thì sao, với sức của ngươi thì có thể làm được gì\\r\\\\nĐã vậy ta sẽ không nương tay với các ngươi\",\"STR_ITEM\":\"\"},{\"id\":8,\"name\":\"Đánh bại Haku\",\"idItem\":-1,\"idNpc\":40,\"idMob\":222,\"idMap\":66,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ra tay đi\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Haku\",\"idItem\":-1,\"idNpc\":40,\"idMob\":-1,\"idMap\":66,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Còn không chịu giơ tay đầu hàng \\\\n40@Thật không ngờ võ công của ngươi lại cao đến như vậy, ta đã đánh giá quá thấp về ngươi, lần sau gặp lại ta sẽ không thua dễ dàng như vậy đâu (vừa nói dứt lời thì phi thân bỏ chạy)\",\"STR_ITEM\":\"\"}]'),
(13, 'Cầu cứu viện binh', 14, 58, 60, 0, 0, '58@Tình hình thế này ta phải gởi thông báo cho làng lá biết, phòng khi có vấn đề gì xảy ra thì vẫn có thể ứng cứu kịp thời\r\\nDạ vâng, con cũng nghĩ giống như ông Byakuren\r\\n58@Con hãy quay về trường Konoha Gakuen và giúp ta giao những bức thư này, con có muốn nhận nhiệm vụ này không?', '58@Khá lắm, không ngờ con lại làm việc nhanh đến như vậy', '', 121632, 3, 0, 10000, '64@True@-1@1@3@4@0,100,110;1,100,110;10,25,30;26,3,3', '[{\"id\":4,\"name\":\"Gởi thư đến Hatake Kakashi\",\"idItem\":386,\"idNpc\":4,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Giao thư\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Gởi thư đến Asuma Sarutobi\",\"idItem\":387,\"idNpc\":7,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Giao thư\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Gởi thư đến Kurenai Yuhi\",\"idItem\":388,\"idNpc\":6,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Giao thư\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Gởi thư đến Maito Gai\",\"idItem\":389,\"idNpc\":8,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Giao thư\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Gởi thư đến Umino Iruka\",\"idItem\":390,\"idNpc\":5,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Giao thư\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Byakuren\",\"idItem\":-1,\"idNpc\":58,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"58@Thế nào rồi, con đã giúp ta thông báo cho tất cả mọi người ở làng lá chưa?\\r\\\\nVâng, con đã làm xong hết rồi ạ\\r\\\\n58@Trong lúc chờ phản hồi từ làng lá, con hãy giúp ta đến Hẻm Núi Mizu bắt hết số gấu trúc mang về đây, đây là số gấu trúc do ta nuôi, ta sợ khi giao chiến sẽ làm tổn thương tới chúng\\r\\\\nVâng, con sẽ đi làm ngay\",\"STR_ITEM\":\"\"},{\"id\":1,\"name\":\"Bắt gấu trúc\",\"idItem\":391,\"idNpc\":-1,\"idMob\":160,\"idMap\":66,\"x\":379,\"y\":328,\"require\":10,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(14, 'Giải cứu Inari', 15, 58, 60, 0, 0, '58@Không xong rồi, Inari là cháu của ông Tazuna, lúc sáng này ra ngoài chơi giờ vẫn chưa thấy về, ta nghi ngờ cậu ấy đã bị bọn Zabuza chặn đường và bắt cóc\r\\nNếu đúng thật là như vậy thì bọn này rất quá đáng, cả đứa trẻ cũng không tha\r\\n58@Con hãy giúp ta ra ngoài tìm Inari và dẫn cậu ấy về đây\r\\nVâng con nhất định sẽ đưa cậu ấy trở về an toàn\r\\n58@Nhưng trước khi đi, ta muốn con tìm hiểu về các gia tộc của nhẫn giả, điều này sẽ rất có ích cho con sau này\r\\n58@Con có muốn nhận nhiệm vụ này không?', 'Ông Byakuren, con đã dẫn Inari về rồi nè \\n58@Con làm tốt lắm, ta thay mặt cho ông Tazuna cảm ơn con vì đã cứu cháu ông ấy \\nKhông có gì, đây là việc con nên làm mà \\n58@Ta có chút phần thưởng xem như hậu tạ', '', 35000, 4, 0, 20000, '104@True@-1@1@1@4@0,100,110;1,100,110;8,25,30;27,3,3', '[{\"id\":44,\"name\":\"Tìm hiểu gia tộc\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm Inari\",\"idItem\":-1,\"idNpc\":23,\"idMob\":-1,\"idMap\":62,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Em có phải là Inari không?\\r\\\\n23@Vâng, đúng là em, ~ là ai tại sao lại biết em\\r\\\\nTa là # được sự nhờ cậy của ông Byakuren và đang đi làm em. Tại sao em lại ở nơi này?\\r\\\\n23@Lúc sáng em đang đi chơi ở sau núi thì bỗng dưng có 2 kẻ lạ mặt, bọn chúng đã bắt cóc em, sau đó không biết vì lý do gì bọn chúng đã thả cho em về\\r\\\\nEm có nhận ra khuôn mặt của bọn chúng không, có phải là bọ Zabuza không?\\r\\\\n23@Zabuza là ai em cũng không rõ, còn về bọn bắt cóc, chúng có đeo bịt mặt nên em không nhận ra\\r\\\\nThôi được rồi, ta sẽ dẫn em về, nơi này rất là nguy hiểm\",\"STR_ITEM\":\"\"},{\"id\":7,\"name\":\"Dẫn Inari về\",\"idItem\":-1,\"idNpc\":23,\"idMob\":223,\"idMap\":62,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Về nhà thôi\",\"STR_ITEM\":\"{1552,205}, {1552,205}, {1434,220}, {1375,396}, {1425,486}, {1542,504}, {1580,620}, {1433,658}, {1267,638}, {1129,655}, {1012,680}, {885,638}, {738,688}, {575,627}, {438,658}, {302,631}, {136,605}, {223,536}, {339,504}, {244,406}, {135,405}, {33,406}\"}]'),
(15, 'Chữa lành vết thương', 16, 58, 60, 0, 0, '58@Có chuyện không hay rồi, sau khi Inari trở về đã đột nhiên đỗ bệnh, sức khỏe của cậu ấy đang rất yếu\n\\nBệnh của cậu ấy có nguy hiểm đến tính mạng không, thưa ông Byakuren?\n\\n58@Nếu không chữa trị kịp thời, ta e rằng cậu ấy sẽ không qua khỏi\n\\nVậy bây giờ con có thể giúp gì được, ông Byakuren cứ dặn dò, con sẽ cố gắng làm hết sức\n\\n58@Trước tiên con hãy đến bên kia hái giúp ta một ít xa trục thảo\n\\n58@Con có nhận nhiệm vụ này không?', '58@Tốt rồi, mau đưa xa trục thảo và nước tinh khiết cho ta, hy vọng có thuốc này Inari sẽ mau chóng lành bệnh', '', 36000, 5, 0, 30000, '54@True@-1@1@1@4@0,100,110;1,100,110;8,25,30;26,3,3', '[{\"id\":2,\"name\":\"Hái xa trục thảo\",\"idItem\":195,\"idNpc\":-1,\"idMob\":144,\"idMap\":60,\"x\":662,\"y\":288,\"require\":10,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với ông Byakuren\",\"idItem\":-1,\"idNpc\":58,\"idMob\":-1,\"idMap\":60,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Con đã hái xong xa trục thảo rồi nè ông Byakuren\\r\\\\n58@Tốt lắm, nhưng như vậy vẫn chưa đủ, để chế biến thành thuốc trị thương cần phải có thêm nước tinh khiết, ta nghĩ nước suối ở thung lũng tận cùng là loại thích hợp nhất\\r\\\\nVâng, con sẽ đến đó mang nước về đây cho ông Byakuren\",\"STR_ITEM\":\"\"},{\"id\":12,\"name\":\"Lấy nước tinh khiết\",\"idItem\":205,\"idNpc\":-1,\"idMob\":-1,\"idMap\":83,\"x\":658,\"y\":342,\"require\":5,\"STR\":\"Đang lấy nước\",\"STR_ITEM\":\"206\"}]'),
(16, 'Tìm lại tấm bản đồ', 17, 58, 60, 0, 0, '58@Hôm nay ta sẽ kể cho con nghe về 1 bí mật, theo ta nghĩ mục đích của Zabuza tấn công làng sương mù có liên quan đến bí mật này\r\\nBí mật đó là gì, ông Byakuren hãy mau kể cho con nghe đi\r\\n58@Cách đây hơn 10 năm, có 1 cao nhân trong làng đã ghi chép lại 1 loại nhẫn thuật vào 1 quyển bí kíp, loại nhẫn thuật này có sức mạnh vô cùng khủng khiếp tuy nhiên người sử dụng nhẫn thuật này sẽ phải trả giá bằng chính tính mạng của mình\r\\nThật không ngờ trên đời lại có loại nhẫn thuật như vậy\r\\n58@Trong 1 lần giao chiến để bảo vệ ngôi làng, vị cao nhân đó đã buộc phải sử dụng nhẫn thuật này, đồng thời cũng đã hy sinh tính mạng, từ đó về sau ta đã cấu giấu rất kỹ quyển bí kíp để không ai được học nhẫn thuật đó nữa\r\\n58@Ta đã cẩn trọng ghi lại nơi cất giấu vào 1 tấm bản đồ, tuy nhiên trong 1 lần bất cẩn đã bị bọn chó hoang cắn xé và mang đi mất\r\\nVậy bây giờ ông muốn con đi tìm lại tấm bản đồ đó, có đúng vậy không?\r\\n58@Đúng vậy, mục đích là tìm ra quyển bí kíp năm xưa và đem thiêu hủy nó, có như vậy Zabuza sẽ không còn lý do gì để tấn công làng sương mù nữa, ta tin rằng ý đồ chính của bọn chúng là nhằm vào quyển bí kíp này\r\\n58@Con có nhận nhiệm vụ này không?', '58@Con làm tốt lắm, tuy tấm bản đồ không còn nguyên vẹn, nhưng ta nghĩ bao nhiêu đây cũng đủ để ta làm lại được quyển bí kíp', '', 37000, 0, 0, 40000, '134@True@-1@1@5@0@55,0,500;59,0,500', '[{\"id\":1,\"name\":\"Thu thập mãnh bản đồ\",\"idItem\":392,\"idNpc\":-1,\"idMob\":161,\"idMap\":61,\"x\":1060,\"y\":517,\"require\":20,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(17, 'Truy tìm bí kíp', 18, 58, 60, 0, 0, '58@Ta vừa ghép xong tấm bản đồ từ những mảnh giấy con đưa cho ta, con hãy lần theo manh mối trên tấm bản đồ này để tìm ra quyển bí kíp nhé\r\\nVâng, con sẽ cố gắng tìm cho bằng được quyển bí kíp\r\\n58@Thời gian không còn sớm, con hãy giúp ta tìm càng nhanh càng tốt', '58@Con làm việc tốt hơn cả sự mong đợi của ta, hãy mau đưa ta xem có đúng đây là quyển bí kíp cấm thuật ta đang cần tìm không', '', 38000, 0, 0, 50000, '168@True@604800000@1@0@0@', '[{\"id\":10,\"name\":\"Tìm lại bí kíp\",\"idItem\":209,\"idNpc\":-1,\"idMob\":-1,\"idMap\":61,\"x\":1196,\"y\":287,\"require\":1,\"STR\":\"3276\",\"STR_ITEM\":\"399\"}]'),
(18, 'Xóa bỏ cấm thuật', 19, 58, 60, 0, 0, '58@Vì quyển bí kíp này mà đã làm cho làng sương mù gặp biết bao nhiêu sóng gió, con hãy giúp ta đem nó đến 1 nơi hoang vắng và đốt nó đi, sau này sẽ không còn ai có thể sở hữu nó nữa\r\\nVâng con hiểu rồi, con sẽ làm đúng như lời ông Byakuren căn dặn\r\\n58@Con có muốn nhận nhiệm vụ này không?', '58@Con lại lập công cho làng sương mù nữa rồi, ta thay mặt cho những người trong làng gởi lời cảm ơn đối với con \\nĐây là việc con nên làm mà, ông Byakuren đừng nên nói vậy', '', 39000, 5, 0, 60000, '3@True@-1@2@0@0@', '[{\"id\":3,\"name\":\"Tiêu hủy bí kíp\",\"idItem\":394,\"idNpc\":-1,\"idMob\":-1,\"idMap\":62,\"x\":219,\"y\":408,\"require\":1,\"STR\":\"Đang đốt bí kíp\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với ông Byakuren\",\"idItem\":-1,\"idNpc\":58,\"idMob\":-1,\"idMap\":60,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ông Byakuren, con đã làm theo lời ông dặn, đốt bỏ quyển bí kíp đó rồi, từ nay sẽ không còn ai nhìn thấy nó nữa\\r\\\\n58@Tốt lắm, hy vọng Zabuza nghe được tin này và sẽ từ bỏ âm mưu tấn công làng sương mù\\r\\\\nÔng Byakuren còn có việc gì nhờ còn cần làm nữa không?\\r\\\\n58@Con rất có lòng nghĩa hiệp, nếu đã thế con hãy giúp ta tiêu diệt số chuột chù, chúng đang phát triển rất nhanh và gây hại đến hoa màu của dân làng\\r\\\\nVâng con sẽ đi làm ngay\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Tiêu diệt chuột chù\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":162,\"idMap\":61,\"x\":1488,\"y\":517,\"require\":30,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(19, 'Trận chiến sống còn', 20, 58, 60, 0, 0, '58@Không xong rồi, Zabuza sau khi hay tin bí kíp bị tiêu hủy, hắn không những không từ bỏ ý định mà còn tức giận lên đánh trọng thương nhiều người trong làng\r\\nCon không thể nhường nhịn được nữa rồi, xin ông Byakuren hãy cho con ra đó và ứng chiến với hắn\r\\n58@Trước tình thế này, chỉ còn cách giao chiến để bảo vệ các cư dân trong làng\r\\nChúng ta càng nhịn, hắn sẽ càng làm tới\r\\n58@Ta cũng nghĩ vậy, bây giờ con hãy đi đến lãnh địa thất kiếm tìm cách ứng phó với Zabuza, tuy nhiên nếu kẻ địch quá mạnh thì con phải biết tìm đường rút lui\r\\nVậy, ông Byakuren hãy giao việc này cho con giải quyết\r\\n58@Con có muốn nhận nhiệm vụ này không?', 'Ông Byakuren, con đã đánh bại được Zabuza, tuy tốn rất nhiều chakra, nhưng cuối cùng cũng hoàn thành được nhiệm vụ \\n58@Thật vất vả cho con, từ nay dân làng ta được sống yên ổn rồi, ta có chút phần thưởng để đền cảm tạ con vì đã ra tay giúp đỡ', '', 40000, 0, 0, 70000, '4@True@-1@1@0@0@', '[{\"id\":5,\"name\":\"Gặp mặt Zabuza\",\"idItem\":-1,\"idNpc\":103,\"idMob\":-1,\"idMap\":57,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ngươi có phải là Zabuza, con quỷ của làng sương mù?\\r\\\\n103@Còn ngươi chính là Nhẫn Giả của làng lá, người vừa đánh bại Haku\\r\\\\nTại sao ngươi lại nở ra tay đối với những người dân vô tội, có ta ở đây ngươi đừng hồng làm tổn thương thêm 1 ai khác\\r\\\\n103@Để ta xem, một đứa trẻ như ngươi thì có thể làm được gì\",\"STR_ITEM\":\"\"},{\"id\":8,\"name\":\"Đánh bại Zabuza\",\"idItem\":-1,\"idNpc\":103,\"idMob\":224,\"idMap\":57,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ra tay đi\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Zabuza\",\"idItem\":-1,\"idNpc\":103,\"idMob\":-1,\"idMap\":57,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"103@Thật không ngờ, làng lá lại có cao thủ giỏi võ đến như vậy \\\\nNgươi thua vì đã quá khinh địch, tuy võ công ta không giỏi như ngươi nhưng vì là việc chính nghĩa ta quyết chiến đấu tới cùng\",\"STR_ITEM\":\"\"}]'),
(20, 'Kì thi Chunin', 22, 28, 60, 0, 0, '28@Nhiệm vụ lần trước con làm rất tốt, ta đã có nghe ông Byakuren khen ngợi rất nhiều về con\r\\nDạ vâng, đó là bổn phận của một Nhẫn Giả nên làm\r\\n28@Sắp tới đây bên trường Konoha Gakuen có tổ chức cuộc thi tuyển chọn chunin, những Nhẫn Giả có đủ điều kiện yêu cầu sẽ được tham gia cuộc thi này, và con được có tên trong danh sách lần thi này\r\\nThật tuyệt, thế thì còn gì bằng\r\\n28@Nhiệm vụ tiếp theo của con là hoàn thành cuộc thi này, con có nhận nhiệm vụ này không?', '28@Con đã vượt qua kỳ chunin nhanh hơn ta mong đợi, tuy nhiên ta cảm thấy con vẫn chưa sẵn sàng cho để trở thành chunin\r\\nNhư vậy có nghĩa là sao, ông Sarutobi\r\\n28@Ta nghĩ con cần thêm thời gian để trở thành chunin, con hãy quay lại dự thi vào lần tới nhé', '', 42000, 0, 0, 80000, '4@True@-1@1@1@0@0,20,30;1,20,30;8,5,10;26,2,2', '[{\"id\":5,\"name\":\"Nói chuyện với Ibiki Morino\",\"idItem\":-1,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"96@* có phải là #\\r\\\\nDạ vâng, em chính là #, em đến đây để thi lên cấp trở thành Nhẫn Giả Chunin\\r\\\\n96@Ta là Ibiki Morino, là một trong 2 giám khảo của cuộc thi Chunin lần này, ta sẽ ra đề trước nếu \\u0026 vượt qua được sẽ lọt vào vòng trong và tham gia thử thách ở khu rừng chết\\r\\\\nDạ vâng, xin thầy cứ ra đề, em sẽ cố gắng để hoàn thành cuộc thi này\",\"STR_ITEM\":\"\"},{\"id\":6,\"name\":\"Thi lý thuyết\",\"idItem\":-1,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":5,\"STR\":\"\",\"STR_ITEM\":\"Trong game Làng Nhẫn Giả, tỉ lệ chí mạng gây thêm sát thương là bao nhiêu?;1;3.2;1.8;1.5;2.0\\r\\\\nĐể vào được khu luyện tập thì cần gặp Npc nào?;0;Shizune;Anko Mitarashi;Mei Terumi;Chiyo​\\r\\\\nMuốn tăng kinh nghiệm khi đánh quái cần có vật phẩm gì?;2;Thỏi vàng;Xích linh chi;Nhân sâm;Túi thức ăn\\r\\\\nKhi kích vũ khí khác hệ thì cần có vật phẩm gì?;3;Thú nuôi;Áo choàng;Bí kíp;Tanto\\r\\\\nVật phẩm cải trang có công dụng gì?;1;Thay đổi diện mạo;Tăng chỉ số và thay đổi diện mạo;Làm người khác không nhìn thấy;Có được tuyệt kỹ của người cải trang\"},{\"id\":5,\"name\":\"Nói chuyện với Anko\",\"idItem\":-1,\"idNpc\":99,\"idMob\":-1,\"idMap\":69,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Chị Anko, chúng ta lại gặp nhau\\r\\\\n99@Đúng vậy, nhưng lần nay chị sẽ là giám khảo thứ 2 của cuộc thi Chunin lần này\\r\\\\n99@Thi thực hành lần này sẽ là tiêu diệt rắn lục ở Thung Lũng Chết, em phải hết sức cẩn thận nếu chẳng may bị rắn cắn phải sẽ nguy hiểm đến tính mạng\\r\\\\nCảm ơn chị đã nhắc nhở, em sẽ cố gắng hết sức để hoàn thành nhiệm vụ\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Tiêu diệt rắn lục\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":164,\"idMap\":64,\"x\":690,\"y\":348,\"require\":50,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(21, 'Bắt đầu thử thách', 24, 28, 69, 0, 0, '28@Sắp tới ta có rất nhiều nhiệm vụ quan trọng giao cho con, độ khó của nhiệm vụ cũng sẽ tăng lên, chỉ cần 1 sơ xuất nhỏ cũng có thể mất cả tính mạng\r\\nCon sẽ không sợ, và không lùi bước, ông Sarutobi cứ giao nhiệm vụ cho con\r\\n28@Tốt lắm, tinh thần Nhẫn Giả của con rất đáng khen ngợi, tuy nhiên để tránh trường hợp đáng tiếc xảy ra, ta cần kiểm tra trình độ của con trước khi giao nhiệm vụ tiếp theo\r\\nKiểm tra như thế nào vậy, ông Sarutobi?\r\\n28@Con hãy tìm đến ông Raikage và xin vào trong tầng hầm địa cung, bên trong đó cũng không kém phần nguy hiểm, con hãy cố gắng đừng để bị thương khi vào trong đó nhé\r\\n28@Con có muốn nhận nhiệm vụ này không?', '28@Tốt lắm, xem như con đã qua được thử thách đầu tiên', '', 44000, 5, 0, 90000, '4@True@-1@2@5@0@55,0,500;59,0,500', '[{\"id\":26,\"name\":\"Hoàn thành khám phá địa cung\",\"idItem\":244,\"idNpc\":59,\"idMob\":-1,\"idMap\":60,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(22, 'Thử thách tiếp theo', 26, 28, 69, 0, 0, '28@Thử thách tiếp theo, con phải hoàn thành 2 lần nhiệm vụ thu phục mãnh thú và 10 lần nhiệm vụ tuần hoàn, nếu qua được thử thách này xem như con đã đạt được yêu cầu \\n28@Con có muốn nhận nhiệm vụ này không?', '28@Làm tốt lắm, con rất có tố chất của một Nhẫn Giả. Tiếp theo, con hãy nhận phần thưởng và tìm đến Killer B để thực hiện nhiệm vụ, ông ấy sẽ có nhiều nhiệm vụ để giao cho con làm', '', 51174, 10, 0, 100000, '4@True@-1@3@0@0@', '[{\"id\":27,\"name\":\"Hoàn thành thu phục mãnh thú\",\"idItem\":-1,\"idNpc\":98,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":28,\"name\":\"Hoàn thành 10 nhiệm vụ tuần hoàn\",\"idItem\":-1,\"idNpc\":102,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(23, 'Nhiệm vụ cấp độ B', 28, 24, 69, 0, 0, 'Chào ông, ông có phải là Killer B không ạ?\r\\n24@Đúng vậy, ta chính là Killer B, con tìm ta có việc gì không?\r\\nCon tên #, là học viên Nhẫn Giả của trường Konoha Gakuen, ông Sarutobi bảo con đến đây để nhận nhiệm vụ\r\\n24@Thế à, ta cũng đang cần tìm người giúp đỡ đây. Ta đang bào chế một loại đan dược có thể tăng cường charka cho người sử dụng đan dược này\r\\nÔng có việc gì cần làm, hãy giao cho con\r\\n24@Ta đang cần thêm nọc đọc của loài rết đỏ để bào chế loại đan dược này, tuy nhiên phải là loại nọc của những con rết tinh anh thì mới có hiệu quả\r\\n24@Con hãy giúp ta đem nọc đọc của chúng mang về đây, con có nhận nhiệm vụ này không?', '24@Đan dược của ta sắp được bào chế thành công rồi, hãy mau đưa nọc đọc rết đỏ cho ta', '', 74249, 0, 0, 100000, '5@True@-1@1@0@0@', '[{\"id\":29,\"name\":\"Lấy nọc đọc rết đỏ tinh anh\",\"idItem\":395,\"idNpc\":-1,\"idMob\":167,\"idMap\":63,\"x\":592,\"y\":413,\"require\":2,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(24, 'Cần thêm nguyên liệu', 30, 24, 69, 0, 0, '24@Vẫn cần thêm một loại nguyên liệu nữa thì mới có thể bào chế được\r\\nĐó là loại nguyên liệu gì, con sẽ đi lấy mang về cho ông Killer B\r\\n24@Là đuôi của loài cáo 3 đuôi ở đồi hoang, loài cáo này rất thông minh, không dễ gì bắt được chúng\r\\nNếu lấy đuôi của chúng như vậy thì có tàn nhẫn quá không, ông Killer B?\r\\n24@Con yên tâm đuôi của chúng sẽ tự mọc lại sau một thời gian, đây là cơ chế đặc biệt của loài cáo này\r\\n24@Con chỉ cần cắt đuôi của chúng và mang về, đừng sát hại sinh linh vô tội, con có muốn nhận nhiệm vụ này không?', '24@Tốt rồi, lần này nhất định ta sẽ bào chế thành công loại đan dược này', '', 102078, 10, 0, 100000, '5@True@-1@1@0@0@', '[{\"id\":1,\"name\":\"Thu thập đuôi cáo\",\"idItem\":396,\"idNpc\":-1,\"idMob\":168,\"idMap\":65,\"x\":373,\"y\":426,\"require\":60,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(25, 'Lễ hội Todoroki Taisha', 32, 33, 63, 0, 0, 'Ông có phải là Jirochou, con là # Nhẫn Giả của Làng Lá, theo lệnh của ngài Hokage đến đây để thu thập thông tin về nhiệm vụ\r\\n33@Con đã đến đây rồi thì hay quá, ta đang rất cần sự giúp đỡ\r\\nÔng Jirochou, có việc gì cần giúp đỡ hãy cứ giao cho con\r\\n33@Ta là cư dân của làng chài Dagarashi, ở làng ta có 2 gia tộc chính đó là gia tộc Wasabi và gia tộc Wagarashi. Ta chính là người đứng đầu của gia tộc Wasabi\r\\n33@Truyền thuyết bắt nguồn từ nhiều năm trước, cứ 4 năm 1 lần dân làng sẽ tổ chức lễ hội Todoroki Taisha, đây là cuộc thi của 2 gia tộc Wasabi và Wagarashi. Mỗi bên sẽ cử 1 thành viên để tham gia dâng ngọc Ryuko cho Todoroki Taisha\r\\n33@Năm nay gia tộc của ta đã cử Idate Morino để tham gia thi đấu, tuy nhiên trong quá trình thi đấu gia tộc Wagarashi đã dùng thủ đoạn cho người phục kích Idate để ngăn cản không cho cậu ấy hoàn thành nhiệm vụ\r\\nCó phải ông Jirochou, muốn con thay Idate để tham gia cuộc thi này?\r\\n33@Không phải như thế, ta muốn con hộ tống Idate để hoàn thành cuộc thi này, điều lệ cuộc thi cho phép sự giúp đỡ từ những người bên ngoài, miễn sao hoàn thành được đích đến là xem như thắng cuộc\r\\nThì ra là thế, con sẽ cố gắng hết sức để giúp đỡ Idate hoàn thành nhiệm vụ\r\\n33@Con có muốn nhận nhiệm vụ này không?', 'Ông Jirochou, cuối cùng con đã đưa Idate về đích cuộc thi an toàn\r\\n33@May quá, nhờ có & mà gia tộc Wasabi đã giành chiến thắng trong cuộc đua năm nay, ta thay mặt các thành viên trong gia tộc xin chân thành cảm ơn # đã ra tay giúp đỡ\r\\nÔng Jirochou đừng nên nói vậy, đây cũng chính là nhiệm vụ con nên làm mà\r\\n33@Ta có chút phần thưởng dành cho con', '', 500000, 0, 0, 100000, '5@True@-1@1@0@0@', '[{\"id\":5,\"name\":\"Tìm Idate Morino\",\"idItem\":-1,\"idNpc\":34,\"idMob\":-1,\"idMap\":71,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Xin chào, anh có phải là Idate Morino?\\r\\\\n34@* là ai, từ đâu đến đây, sao lại biết tên ta\\r\\\\nEm là #, là Nhẫn Giả của Láng Lá, ông Jirochou nhờ em đến đây để giúp đỡ anh. Nhắc mới nhớ họ Morino nghe rất quen, em đã từng nghe qua rồi nhưng lại không nhớ rõ lắm\\r\\\\n34@Ta cũng từng là người của Làng Lá, Ibiki Morino chính là anh trai của ta\\r\\\\nĐúng rồi, Ibiki Morino là giám khảo trong kì thi Chunin ở trường Konoha Gakuen. Anh là người của Làng Lá nhưng sao lại lưu lạc đến nơi này?\\r\\\\n34@Chuyện kể ra rất dài, khi nào có cơ hội ta sẽ kể cho em nghe, vấn đề bây giờ ta phải rất rút về đích trong cuộc đua ở lễ hội Todoroki Taisha\\r\\\\nMãi lo nói chuyện làm em quên mất, bây giờ em sẽ hộ tống anh về đích đến nơi an toàn, đây chính là nhiệm vụ của em\",\"STR_ITEM\":\"\"},{\"id\":7,\"name\":\"Hộ tống Idate Morino\",\"idItem\":-1,\"idNpc\":34,\"idMob\":225,\"idMap\":71,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Lên đường thôi\",\"STR_ITEM\":\"{384,121}, {384,121}, {403,238}, {612,361}, {517,406}, {413,405}, {289,403}, {156,436}, {273,536}, {383,582}, {231,703}, {394,703}, {534,703}, {657,704}, {795,702}, {992,701}, {1142,701}, {1277,701}\"}]'),
(26, 'Nổi buồn của Idate', 34, 34, 71, 0, 0, 'Anh Idate, cuộc đua đã kết thúc rồi, nhưng sao anh vẫn không được vui\r\\n34@Không dám giấu gì #, ta vẫn còn rất buồn vì chuyện đã phải rời khỏi Làng Lá, tuy chuyện đã xảy ra rất lâu nhưng ta vẫn không thể nào quên được\r\\nMọi việc như thế nào, anh có thể kể rõ em nghe được không?\r\\n34@Lúc trước, ta cũng như & là một học viên Nhẫn Giả của trường Konoha Gakuen, lúc bấy giờ thầy dạy của ta là Rokusho Aoi. Trong kì thi Chunin năm đó ta đã thất bại, không thể vượt qua được kì thi\r\\n34@Khi đó, thầy của ta Rokusho Aoi đã dùng lời lẽ ngon ngọt bảo ta đánh cắp bí kíp cấm thuật và thanh Lôi Thần Kiếm, ông ấy hứa sau khi hoàn thành sẽ giúp ta trở thành Chunin của Làng Lá, do khi đó ta còn nhỏ và chưa nhận thức chín chắn nên đã nhận lời đề nghị đó\r\\n34@Sau khi đánh cắp được bí kíp cấm thuật và thanh Lôi Thần Kiếm, Rokusho Aoi không những đã không giữ đúng lời hứa mà còn dụ dỗ ta đào tẩu đến Làng Mưa\r\\n34@Do đã phạm phải điều cấm kỵ nên ta buộc lòng phải rời khỏi Làng Lá và từ đó lưu lạc đến làng chài Dagarashi và gặp ông Jirochou, ông ấy đã cưu mang và giúp đỡ ta rất nhiều trong quãng thời gian này\r\\nNói như vậy người đứng sau mọi chuyện đó chính là Rokusho Aoi\r\\n34@Ta đã không nghĩ đến việc này, nhưng trong cuộc đua vừa qua, người đã phục kích đánh trọng thương ta và ngăn không cho ta đến đích lại là Rokusho Aoi, ông ấy đã trở thành tay sai của gia tộc Wagarashi\r\\nRokusho Aoi thật là quá đáng, nếu để em gặp được em sẽ cho dạy cho hắn một bài học\r\\n34@Ta được biết Rokusho Aoi đang ở chân núi Tsuchi, ta cũng rất muốn gặp ông ấy hỏi cho ra lẽ, tại sao năm xưa lại đối xử với ta như thế\r\\n34@# có thể thay ta làm việc này không?', '34@Thế nào rồi, em đã gặp được Rokusho Aoi chưa?\r\\nEm đã gặp được Rokusho Aoi, không những vậy mà con giao đấu với hắn nữa, tuy nhiên em vẫn chưa hỏi được gì sau khi giao đấu xong hắn đã rút lui bỏ chạy\r\\n34@Mọi chuyện đã như thế thì đành vậy, dù sao thì ta cũng xin cảm tạ em vì đã ra tay giúp đỡ', 'Ghi chú: Nếu không thể tự hoàn thành nhiệm vụ này hãy tìm thêm đồng đội để trợ giúp', 1500000, 0, 0, 100000, '5@True@-1@1@0@0@', '[{\"id\":5,\"name\":\"Gặp Rokusho Aoi\",\"idItem\":-1,\"idNpc\":35,\"idMob\":-1,\"idMap\":72,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ngươi có phải Rokusho Aoi?\\r\\\\n35@Ranh con, ăn nói cho cẩn thận, nếu không thì đừng có trách ta\\r\\\\nTa được sự nhờ cậy của anh Idate, hôm nay đến đây để hỏi cho ra lẽ\\r\\\\n35@Thì ra là tên bất tài nhu nhược đó, những lỗi lầm năm xưa đều là do hắn tự gây ra mà thôi. Nhưng một đứa ranh con như ngươi thì có tài cán gì mà dám đến đây hỏi tội ta\\r\\\\nNếu đã như thế thì ta đành phải ra tay vậy, để xem võ công của ông cao đến cỡ nào\",\"STR_ITEM\":\"\"},{\"id\":8,\"name\":\"Giao đấu với Rokusho Aoi\",\"idItem\":-1,\"idNpc\":35,\"idMob\":226,\"idMap\":72,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ra tay đi\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Rokusho Aoi\",\"idItem\":-1,\"idNpc\":35,\"idMob\":-1,\"idMap\":72,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"35@Thật không ngờ, ta lại bại dưới tay mốt đứa ranh con như ngươi \\\\nGiờ thì, hãy nói đi tại sao năm xưa ngươi lại đối xử với anh Idate như vậy \\\\n35@Mối nhục này, sao này ta nhất định sẽ trả lại ngươi gấp trăm lần (vừa nói xong phi thân bỏ chạy)\",\"STR_ITEM\":\"\"}]'),
(27, 'Chuộc lại lỗi lầm', 36, 34, 71, 0, 0, 'Anh Idate có cần em giúp gì nữa không?\r\\n34@Ta vẫn còn rất ái nái vì việc làm năm xưa đã gây ra\r\\nAnh Idate đừng nói như vậy, mọi chuyện đều do Rokusho Aoi gây ra mà thôi\r\\n34@Biết là như thế nhưng bảo vật của Làng Lá đúng là do chính ta đánh cắp\r\\nNếu vậy, em có thể giúp được gì trong chuyện này\r\\n34@Ta được biết Rokusho Aoi đã chia nhỏ bí kíp cấp thuật ra và cất giấu ở Vách Đá Ngang, em có thể giúp ta tìm lại bí kíp cấm thuật của Làng Lá không?', 'Anh Idate em đã đem những mảnh ghép của quyển bí kíp về rồi nè \\n34@Hay quá, cuối cùng ta cũng có thể trả lại quyển bí kíp này lại cho Làng Lá rồi, em hãy mau đưa những mảnh bí kíp cho ta', '', 2500000, 10, 0, 100000, '5@True@-1@1@0@0@', '[{\"id\":1,\"name\":\"Tìm lại mảnh bí kíp\",\"idItem\":398,\"idNpc\":-1,\"idMob\":171,\"idMap\":70,\"x\":573,\"y\":443,\"require\":100,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(28, 'Bảo vật Làng Lá', 38, 34, 71, 0, 0, '34@Vẫn còn một bảo vật nữa mà năm xưa ta đã đánh cắp\r\\nĐó có phải là thanh Lôi Thần Kiếm không?\r\\n34@Đúng như vậy, đó là một trong 2 loại bảo vật năm xưa ta đã lấy của Làng Lá\r\\nNhưng làm sao để tìm lại được thanh kiếm này\r\\n34@Trong thời gian lưu lạc ở làng chài Dagarashi, ta đã âm thầm theo dõi Rokusho Aoi và biết được nơi cất giấu thanh Lôi Thần Kiếm\r\\n34@Sau đó ta đã ghi chép lại nơi cất giấu trong tấm bản đồ này, em cứ đi theo sự chỉ dẫn trong tấm bản đồ sẽ tìm ra được thanh Lôi Thần Kiếm\r\\n34@Em có muốn giúp ta làm nhiệm vụ tìm lại thanh bảo kiếm không?', '34@Em thật có lòng nghĩa hiệp, cuối cùng tâm nguyện trả lại bảo vật cho Làng Lá của ta cũng sắp trở thành hiện thực \\nAnh đã quá lời rồi, giúp đỡ người khác cũng là chuyện nên làm của một Nhẫn Giả mà \\n34@Hãy mau đưa thanh kiếm cho ta, rồi ta sẽ hậu tạ', '', 3500000, 0, 0, 100000, '5@True@-1@1@0@0@', '[{\"id\":10,\"name\":\"Tìm lại thanh Lôi Thần Kiếm\",\"idItem\":209,\"idNpc\":-1,\"idMob\":-1,\"idMap\":87,\"x\":530,\"y\":142,\"require\":1,\"STR\":\"3299\",\"STR_ITEM\":\"399\"}]');
INSERT INTO `task` (`id`, `name`, `levelNeed`, `idNpc`, `idMap`, `x`, `y`, `STR1`, `STR2`, `STR3`, `amountExp`, `amountVangKhoa`, `amountBac`, `amountBacKhoa`, `strItem`, `step`) VALUES
(29, 'Hoàn trả bảo vật', 40, 34, 71, 0, 0, '34@Ta vừa ghép xong quyển bí kíp từ những mãnh vụn em đã đưa cho ta\r\\nThế thì hay quá, em sẽ giúp anh hoàn trả lại cho Làng Lá\r\\n34@Đó cũng là điều ta muốn nói, em hãy cố gắng giúp ta thêm lần này\r\\nAnh Idate cứ yên tâm mọi việc hãy cứ để em lo\r\\n34@Ngoài ra, em có thể giúp hỏi thăm sức khỏe của anh trai ta Ibiki Morino\r\\nViệc này thì không thành vấn đề\r\\n34@Đã lâu rồi ta không được gặp anh ấy, em hãy giúp ta bắt một ít cá ở dòng sông trong Láng Đá, và mang về tặng cho anh ấy xem như đó là chút tấm lòng của ta\r\\nAnh thật có lòng, em sẽ cố gắng làm như anh đã nói\r\\n34@Còn đây là bức thư ta gởi cho anh ấy, em nhớ đem bức thư này và giao tận tay anh ấy giúp ta.\r\\n34@Em có thể giúp ta thêm lần này không?', 'Anh Idate, emd đã về rồi đây\r\\n34@Thế nào rồi, em đã giúp ta hoàn trả lại bảo vật cho Làng Lá chưa?\r\\nEm đã gặp ông Tobirama, và đưa lại bảo vật cho ông Tobirama. Ông ấy còn nói, sẽ không truy cứu về việc làm của anh nữa\r\\n34@Thế thì hay quá, cuối cùng ta cũng đã gỡ được nút thắt trong lòng bấy lâu nay. Còn về anh trai ta, anh ấy có nói gì không?\r\\nThầy Ibiki Morino đã rất vui khi biết được anh Idate vẫn khỏe mạnh, em cũng đã giao tận tay giỏ cá và bức thư của anh cho thầy ấy\r\\n34@# thật là tốt bụng, ta có chút quà nhỏ, hãy xem như đây là sự đền đáp của ta dành cho em', '', 4500000, 0, 0, 100000, '6@True@-1@1@0@0@', '[{\"id\":30,\"name\":\"Câu cá chép\",\"idItem\":235,\"idNpc\":-1,\"idMob\":-1,\"idMap\":85,\"x\":823,\"y\":693,\"require\":60,\"STR\":\"Đang câu cá\",\"STR_ITEM\":\"236\"},{\"id\":5,\"name\":\"Tìm Ibiki Morino\",\"idItem\":-1,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Thầy Ibiki Morino\\r\\\\n96@# tìm ta có việc gì không?\\r\\\\nSao chuyến đi làm nhiệm vụ vừa rồi em có gặp một người tên là Idate Morino\\r\\\\n96@Em nói sao, có đúng là Idate Morino?\\r\\\\nDạ, đúng là Idate Morino, em còn biết anh ấy chính là em trai của thầy\\r\\\\n96@Vậy là em ta vẫn còn sống, đây đúng là một tin tốt lành, đã lâu rồi ta không có tin tức gì về Idate Morino\\r\\\\nAnh ấy có nhờ em giao bức thư này cho thầy\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Giao thư cho Ibiki Morino\",\"idItem\":400,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Giao thư\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm Ibiki Morino\",\"idItem\":-1,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"96@Đây đúng là chữ viết của em trai ta rồi, tạ ơn trời đất. Hiện tại cuộc sống của em ấy thế nào, ta đã không làm tròn bổn phận của một người anh trai\\r\\\\nAnh ấy đang sống ở làng chài Dagarashi, cuộc sống rất tốt, anh ấy bảo em nếu có cơ hội sẽ về thăm thầy. Còn đây là quà ấy nhờ em gởi cho thầy\\r\\\\n96@Em trai ta thật có lòng, chỉ cần em ấy được bình an vô sự là ta đã thấy yên lòng rồi\",\"STR_ITEM\":\"\"},{\"id\":31,\"name\":\"Giao cá chép cho Ibiki Morino\",\"idItem\":236,\"idNpc\":96,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":60,\"STR\":\"Giao cá chép\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Tìm Senju Tobirama\",\"idItem\":-1,\"idNpc\":92,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Chào ông Tobirama, con có việc cần báo cáo\\r\\\\n92@# đang có việc gì, hãy nói ta nghe xem\\r\\\\nÔng Tobirama vẫn còn nhớ một người tên Idate Morino không?\\r\\\\n92@Ta vẫn còn nhớ chứ, Idate là em trai của Ibiki, lúc trước cậu ấy đã bị Làng Lá truy nã và trở thành Nhẫn Giả lưu vong\\r\\\\nTrong chuyến đi làm nhiệm vụ vừa rồi con đã gặp được anh ấy, và tìm hiểu thì con được biết mọi việc đều do Rokusho Aoi đã gài bẫy anh ấy hồng chiếm đoạt bảo vật Làng Lá\\r\\\\n92@Con có chứng cớ gì không?\\r\\\\nCon đã giao đấu với Rokusho Aoi và còn tìm lại được bảo vật của làng chúng ta đã bị đánh cắp\\r\\\\n92@Con hãy mau đưa ta xem, có đúng là bảo vật năm xưa đã bị đánh cắp không\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Giao trả bí kíp cấm thuật\",\"idItem\":398,\"idNpc\":92,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Trả bí kíp\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Senju Tobirama\",\"idItem\":-1,\"idNpc\":92,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"92@Đây đúng là bí kíp cấm thuật của làng chúng ta rồi, tuy nhiên vẫn còn một bảo vật nữa đó là thanh Lôi Thần Kiếm\\r\\\\nDạ vâng, con cũng đã tìm lại được và mang về đây. Tất cả đều được sự hỗ trợ của anh Idate. Anh ấy vẫn còn cắn rứt vì lỗi lầm năm xưa đã gây ra\\r\\\\n92@Nếu đã tìm lại được bảo vật ta sẽ xem như xóa bỏ tội lỗi của Idate đã gây ra, dù sao cũng không phải là chủ ý của cậu ấy\\r\\\\nAnh Idate nghe được tin này, chắc anh ấy sẽ vui mừng lắm\\r\\\\n92@Con hãy đưa ta xem có đúng là thanh Lôi Thần Kiếm không?\",\"STR_ITEM\":\"\"},{\"id\":4,\"name\":\"Giao trả bí kíp cấm thuật\",\"idItem\":399,\"idNpc\":92,\"idMob\":-1,\"idMap\":86,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Trả lôi thần kiếm\",\"STR_ITEM\":\"\"}]'),
(30, 'Trợ giúp làng cát', 42, 28, 59, 0, 0, 'Ông Sarutobi, lại có chuyện tìm con hả?\r\\n28@Làng Lá và làng Cát bấy lâu nay luôn có tình giao hữu\r\\nDạ vâng, con cũng có nghe nói làng Cát là đồng minh của chúng ta\r\\n28@Hiện tại làng Cát đang gặp chút vấn đề, gần đây ở khu vực đồi cát xuất hiện rất nhiều con bọ gai làm cho cuộc sống của người dân ở đó bị xáo trộn.\r\\n28@Những con bọ gai này đeo bám vào cơ thể người gây ngứa rát vô cùng khó chịu. Đặc biết chúng sinh sản rất nhanh và làng Cát hiện tại đang thiếu nhân lực nên không thể trong 1 lúc diệt trừ hết bọn chúng được\r\\nCó phải ông Sarutobi muốn con đến đồi cát để tiêu diệt lũ bọ gai đó không?\r\\n28@Đúng vậy, giúp đỡ dân làng là việc nên làm, ngoài ra cũng tăng thêm tình gắng kết giữa làng Cát và làng Lá của chung ta\r\\n28@Con có muốn nhận nhiệm vụ này không?', 'Con về rồi đây? \\n28@Thế nào rồi, nhiệm vụ ta giao con đã hoàn thành chưa? \\nÔng Sarutobi cứ yên tâm, từ nay lũ bọ gai sẽ không còn quấy phá dân làng được nữa, con đã tiêu diệt sạch bọn chúng \\n28@Thế thì hay quá, ta có chút phần thưởng dành cho con', '', 10000000, 15, 0, 100000, '160@True@-1@30@0@0@', '[{\"id\":0,\"name\":\"Tiêu diệt bọ gai\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":174,\"idMap\":80,\"x\":768,\"y\":570,\"require\":100,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(31, 'Giúp đỡ Gaara', 44, 36, 80, 0, 0, 'Cậu có phải là Gaara?\r\\n36@Đúng vậy chính là ta, Gaara của sa mạc\r\\nTa có nghe nói trong kì thi Chunin lần trước cậu cũng có tham gia, ta cũng rất hy vọng sẽ có dịp so tài cùng với cậu\r\\n36@Vậy ra ngươi đến từ làng lá?\r\\nĐúng vậy ta là #, làng của ta nhận được tín hiệu cầu cứu từ Nhẫn Giả của làng cát và ngài Hokage đã cử ta đến đây để làm nhiệm vụ, phải chăng làng của cậu đang gặp nguy hiểm?\r\\n36@Những ngày trước, làng của ta bị tấn công bởi một nhóm người được gọi là Tứ Thiên Vương\r\\nTứ Thiên Vương?\r\\n36@Bọn họ là những người của làng Takumi, tuy không giỏi về nhẫn thuật nhưng bù lại khả năng chế tạo vũ khí công nghệ của họ rất tốt, có thể chống lại được những Nhẫn Giả có võ công cao cường\r\\n36@Matsuri là đệ tử ta vừa thu nhận, bọn chúng đã biết được tin này và bắt cóc Matsuri, ta đang lần theo dõi tung tích của bọn chúng thì gặp & ở đây\r\\nTa sẽ giúp cậu giải thoát cho Matsuri\r\\n36@Để cắt đuôi sự theo sau của ta, bọn chúng đã chia ra làm 2 hướng, bây giờ một mình ta không thể ngăn cản tất cả bọn chúng, # có thể thay ta giải cứu Matsuri, còn ta sẽ lần theo dấu vết của tên cầm đầu.\r\\n36@* có nhận nhiệm vụ này không?', 'Gaara, ta đã tìm ra được Matsuri và đưa cô ấy trở về an toàn \\n36@Thế thì hay quá, đây phần thưởng dành cho & vì đã ra tay cứu giúp học trò của ta', '', 20000000, 0, 0, 100000, '160@True@-1@30@0@0@', '[{\"id\":5,\"name\":\"Tìm Matsuri\",\"idItem\":-1,\"idNpc\":37,\"idMob\":-1,\"idMap\":78,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Cô có phải là Matsuri không?\\r\\\\n37@Đúng vậy, \\u0026 là ai sao lại biết tên tôi\\r\\\\nTa tên #, ta đến từ Làng Lá là đồng minh của Làng Cát, Gaara nhờ ta tìm tung tích của cô\\r\\\\n37@Cách đây 2 hôm, tôi bị một nhóm người của làng Takumi bắt cóc, mục đích của họ là muốn dụ thầy Gaara vào bẫy, bọn họ đang có ý đồ không tốt đối với thầy ấy\\r\\\\nNhư vậy rất có thể Gaara sẽ gặp nguy hiểm, nhưng mà bọ chúng đâu hết rồi, tại sao chỉ có mỗi mình cô ở nơi này\\r\\\\n37@Lúc sáng này bọn chúng đã bỏ tôi lại nơi này, rất có thể bọn chúng đã đạt được mục đích và thấy tôi không còn giá trị lợi dụng nên đã tha cho tôi\\r\\\\nNếu nói như vậy, ta phải nhanh chóng đưa cô rời khỏi nơi này và quay lại trợ giúp Gaara\\r\\\\n37@Vâng, xin \\u0026 hãy giúp đỡ thầy ấy\",\"STR_ITEM\":\"\"},{\"id\":7,\"name\":\"Giải cứu Matsuri\",\"idItem\":-1,\"idNpc\":37,\"idMob\":228,\"idMap\":78,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Chúng ta về thôi\",\"STR_ITEM\":\"{1369,131}, {1369,131}, {1573,153}, {1612,256}, {1494,319}, {1700,348}, {1488,439}, {1702,470}, {1580,547}, {1372,575}, {1178,544}, {991,543}, {843,438}, {667,437}, {519,437}, {442,344}, {300,345}, {171,320}, {25,320}\"}]'),
(32, 'Tứ Thiên Vương làng Takumi', 46, 36, 80, 0, 0, 'Theo như lời Matsuri nói thì mục tiêu của bọn họ không phải là cô ấy, mà chính là cậu\r\\n36@Tôi biết rõ điều đó, trong quá trình theo dấu bọn họ tôi đã biết được nơi tập kết của chúng\r\\nVậy cậu sẽ dự tính như thế nào?\r\\n36@Nếu bây giờ tôi đi đến đó, chẳng khác nào mắc bẫy của bọn chúng\r\\nKhông lẽ chúng tôi chỉ ở đây ngồi chờ bọn chúng ra tay trước\r\\n36@Không hẳn vậy, bọn chúng vẫn chưa biết & là đồng minh đến giúp đây để giúp đỡ. * có thể đến đó và tấn công bất ngờ làm cho bọn chúng không kịp trở tay\r\\nTôi hiểu rồi, kế hoạch của cậu thật tuyệt!\r\\n36@* có thể giúp tôi làm nhiệm vụ này không?', '36@Tình hình thế nào rồi?\r\\nTôi đã làm theo như kế hoạch cậu nói, ra tay bất ngờ làm chúng không kịp trở tay. Tuy nhiên, tôi cũng rất vất vả lắm mới tiêu diệt được bọn chúng\r\\n36@Lần này nhờ có & mà kẻ địch của chúng tôi đã bị tiêu diệt dễ dàng, tôi có chút phần thưởng dành cho &', '', 30000000, 0, 0, 100000, '6@True@-1@1@0@0@', '[{\"id\":0,\"name\":\"Đánh bại Kujaku\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":230,\"idMap\":56,\"x\":320,\"y\":269,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Đánh bại Ryugan\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":231,\"idMap\":56,\"x\":665,\"y\":187,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Đánh bại Suiko\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":232,\"idMap\":56,\"x\":548,\"y\":536,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":0,\"name\":\"Đánh bại Houki\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":233,\"idMap\":56,\"x\":760,\"y\":393,\"require\":1,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(33, 'Kẻ thù làng cát', 48, 36, 80, 0, 0, 'Gaara, vẫn còn có chuyện gì sao?\r\\n36@Tôi cứ tưởng mọi chuyện đã kết thúc, nhưng không phải như vậy. Tôi cũng vừa nhận được tình báo, những tên lúc nãy & tiêu diệt chỉ là vật thế thân\r\\nKhông lẽ vẫn còn kẻ đứng sau chuyện này?\r\\n36@Đúng như vậy, kẻ đứng sau mọi chuyện chính là Seimei. Ông ấy đang âm mưu chiếm đoạt cho bằng được sức mạnh của Shukaku ở bên trong người tôi\r\\nThì ra là như vậy, tôi sẽ không để chuyện đó xảy ra\r\\n36@Tình báo của tôi đã biết nơi ở thật sự của ông ấy, # có thể thay tôi hoàn thành nhiệm vụ tiêu diệt Seimei không?', 'Gaara, tôi có tin vui cho cậu đây\r\\n36@Có phải & đã tiêu diệt được Seimei?\r\\nĐúng vậy, tuy lão ta rất cứng đầu, nhưng cuối cùng cũng đã bị tôi tiêu diệt\r\\n36@Thật là tốt quá, từ nay làng cát sẽ bớt đi được một kẻ thù\r\\n36@Đây là chút phần thưởng dành cho &', '', 40000000, 0, 0, 100000, '6@True@-1@1@0@0@', '[{\"id\":5,\"name\":\"Nói chuyện với Baki\",\"idItem\":-1,\"idNpc\":104,\"idMob\":-1,\"idMap\":79,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"104@Vậy ra \\u0026 chính là Nhẫn Giả của làng lá\\r\\\\nĐúng vậy, Gaara đã nhận được tình báo về nơi tập kết của Seimei, và nhờ tôi đi tiêu diệt bọn chúng\\r\\\\n104@Ta chính là người đã lần theo tung tích của bọn chúng và báo cho Gaara biết\\r\\\\nThế thì hay quá, ông có thể dẫn tôi đến đó không?\\r\\\\n104@Được rồi, ta sẽ dẫn đường cho \\u0026\",\"STR_ITEM\":\"\"},{\"id\":40,\"name\":\"Đánh bại Seimei\",\"idItem\":-1,\"idNpc\":104,\"idMob\":234,\"idMap\":79,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Mau đi theo ta\",\"STR_ITEM\":\"67\"},{\"id\":5,\"name\":\"Nói chuyện với Baki\",\"idItem\":-1,\"idNpc\":104,\"idMob\":-1,\"idMap\":79,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"104@Thế nào rồi, \\u0026 đã hoàn thành được nhiệm vụ chưa?\\r\\\\nCuối cùng, tôi cũng đã tiêu diệt được lão già Seimei, nhiệm vụ này quả thật không dễ dàng chút nào\\r\\\\n104@Thế thì hay quá, bây giờ \\u0026 hãy giúp ta nhanh chống quay về báo cho Gaara biết được tin vui này\\r\\\\nVâng, tôi sẽ đi ngay\",\"STR_ITEM\":\"\"}]'),
(34, 'Giao lưu võ công với Gaara', 50, 36, 80, 0, 0, '36@Tôi thật không ngờ, võ công của & lại cao cường đến như vậy, ngay cả Seimei kẻ thù của Làng Cát cũng bị & tiêu diệt dễ dàng\r\\nTôi đã phải tập luyện rất nhiều để có được như ngày hôm nay\r\\n36@* thật sự làm tôi rất phấn khích, lần này tôi muốn so tài để phân cao thấp với &\r\\nĐó là một ý kiến tuyệt vời, tôi cũng đang rất phấn khích đây\r\\n36@* có thật sự muốn so tài với tôi không?', 'Thật không thể tin được, mình chưa bao giờ nhìn thấy sức mạnh kinh khủng đến như vậy\r\\n36@Đó chính là sức mạnh của Shukaku ở bên trong cơ thể mình\r\\nLần tới nhất định mình sẽ không để cậu thắng dễ dàng như vậy\r\\n36@Dù sao cũng rất cảm ơn & vì đã giúp đỡ trong thời gian vừa qua, mình có chút phần quà dành cho &', 'Ghi chú: Nếu không thể tự hoàn thành nhiệm vụ này hãy tìm thêm đồng đội để trợ giúp. Ngoài ra khi Gaara biến hình và bị Gaara đánh trọng thương cũng sẽ hoàn thành nhiệm vụ', 50000000, 0, 0, 100000, '6@True@-1@3@0@0@', '[{\"id\":8,\"name\":\"So tài với Gaara\",\"idItem\":-1,\"idNpc\":36,\"idMob\":227,\"idMap\":80,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Ra tay đi\",\"STR_ITEM\":\"\"},{\"id\":5,\"name\":\"Nói chuyện với Gaara\",\"idItem\":-1,\"idNpc\":36,\"idMob\":-1,\"idMap\":80,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"36@Đúng như tôi nghĩ, \\u0026 thật sự rất mạnh, thật không thể xem thường Nhẫn Giả Làng Lá được \\\\nTôi thấy có vẻ cậu vẫn chưa dùng hết sức, phải chăng vừa rồi chỉ là những chiêu thăm dò \\\\n36@Nếu đã như vậy lần này tôi sẽ cho \\u0026 xem sức mạnh thật sự của tôi\",\"STR_ITEM\":\"\"},{\"id\":41,\"name\":\"Sức mạnh của Gaara\",\"idItem\":-1,\"idNpc\":36,\"idMob\":236,\"idMap\":80,\"x\":0,\"y\":0,\"require\":1,\"STR\":\"Dùng hết sức đi\",\"STR_ITEM\":\"\"}]'),
(35, 'Đối đầu với Akatsuki', 52, 31, 68, 0, 0, '31@#, gặp được con ở đây thì hay quá\r\\nÔng tiên nhân háo sắc, ông đang làm gì ở đây\r\\n31@Ta đã bảo đừng bao giờ gọi ta là tiên nhân háo sắc, phải gọi là đại nhân Jiraiya\r\\nHihi, mà ông vẫn chưa trả lời câu hỏi của tôi, ông đang làm gì ở đây?\r\\n31@Ta đang theo dõi hành tung của bọn Akatsuki. Ta đã nhận được tin bọn chúng đang ráo riết truy bắt Jinchuuriki\r\\nMục đích của bọn chúng là gì?\r\\n31@Sau khi bắt được Jinchuuriki, bọn chúng sẽ tách vĩ thú ra khỏi Jinchuuriki. Tất nhiên sau khi tách xong, Jinchuuriki sẽ không thể sống sót\r\\nBọn chúng thật là tàn nhẫn, và không coi ai ra gì\r\\n31@Để đối phó trong tình huống này chúng ta cần phải ra tay trước để làm giảm uy lực của bọn chúng\r\\nÔng tiên nhân háo sắc, có cần con giúp gì không?\r\\n31@Ta muốn con tiêu diệt vài tên Akatsuki, để bọn chúng biết được sự lợi hại của Nhẫn Giả làng ta. Con có muốn nhận nhiệm vụ này không?', 'Ông tiên nhân háo sắc, con đã hoàn thành nhiệm vụ ông căn dặn \\n31@Con làm tốt lắm, bọn chúng vẫn còn khá đông, tuy nhiên cũng xem như đây là một thắng lợi, ta có phần thưởng dành cho con', 'Ghi chú: thành viên của Akatsuki là các cao thủ Nhẫn Giả và các cao thủ ở trong địa cung. Phải tự mình đánh bại thì mới hoàn thành được nhiệm vụ', 60000000, 0, 0, 200000, '6@True@-1@2@0@0@', '[{\"id\":42,\"name\":\"Tiêu diệt thành viên của Akatsuki\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":-1,\"idMap\":-1,\"x\":0,\"y\":0,\"require\":2,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(36, 'Luyện tập', 54, 31, 68, 0, 0, '31@Tạm thời bọn chúng sẽ không còn manh động như trước nữa, nhưng ta nghĩ bọn chúng sẽ không dễ dàng bỏ qua như vậy đâu\r\\nHay là chúng ta mở đợt tấn công vào sào huyệt của bọn chúng\r\\n31@Với tình thế hiện giờ, chúng ta vẫn chưa đủ sức để làm chuyện đó, ta muốn con tranh thủ trong thời gian này luyện tập không ngừng để nâng cao võ công, khi nào bọn chúng đến lần nữa thì sẵn sàng ứng phó\r\\n31@Con có thể chịu đựng nổi những bài luyện tập khắc nghiệt của ta không?', 'Con về rồi đây, hiện tại con thấy tinh thần rất sảng khoái, sức lực tràn trề \\n31@Tốt lắm, võ công của con đã được nâng thêm một bậc, đây là phần thưởng dành cho con', '', 70000000, 0, 0, 200000, '6@True@-1@2@0@0@', '[{\"id\":33,\"name\":\"Đánh bại Dị Cây thủ lĩnh\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":180,\"idMap\":74,\"x\":1381,\"y\":403,\"require\":20,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(37, 'Tiếp tục luyện tập', 56, 31, 68, 0, 0, 'Ông tiên nhân háo sắc, bây giờ chúng ta đã có thể đi được chưa?\r\\n31@Vẫn chưa đâu, bọn Akatsuki có sức mạnh hơn chúng ta rất nhiều, tiếp theo con hãy đến khu vực bên cạnh và luyện tập với những con bọ cánh cứng để tăng thêm sự phản xạ\r\\n31@Con có muốn tiếp nhận bài luyện tập này không?', 'Nhiệm vụ đã hoàn thành, ông tiên nhân háo sắc có căn dặn gì thêm không, hihi  \\n31@Một bài luyện tập khó đến như vậy mà con đã hoàn thành chỉ trong 1 thời gian ngắn, con xứng đáng nhận lấy phần thưởng của ta', '', 80000000, 0, 0, 200000, '6@True@-1@2@0@0@', '[{\"id\":0,\"name\":\"Tiêu diệt bọ cánh cứng\",\"idItem\":-1,\"idNpc\":-1,\"idMob\":181,\"idMap\":88,\"x\":608,\"y\":253,\"require\":500,\"STR\":\"\",\"STR_ITEM\":\"\"}]'),
(38, 'Kế hoạch tác chiến', 58, 31, 68, 0, 0, 'Con nghĩ, bây giờ con đã thực sự đủ mạnh, con đã đủ sức đương đầu với bọn Akatsuki\r\\n31@Sự cố gắng của con thật sự làm ta rất ngạc nhiên, chỉ trong một thời gian ngắn mà võ công của con đã tiến bộ vượt bậc\r\\n31@Tuy nhiên, chúng ta vẫn chưa thật sự nắm rõ về tổ chức Akatsuki, bọn chúng ở trong tối còn chúng ta ở ngoài sáng, lợi thế không nghiêng về chúng ta\r\\nVậy bây giờ chúng ta phải làm thế nào hả, ông tiên nhân háo sắc?\r\\n31@Ở khu vực bên cạnh có rất nhiều nấm độc và bọ cạp xanh cực độc, con hãy đi lấy một ít nọc bọ cạp và nấm độc mang về đây cho ta\r\\nNọc bọ cạp và nấm độc thì có liên quan gì hả, ông tiên nhân háo sắc?\r\\n31@Con thật sự là một tên đại ngốc. Chất độc như thế tất nhiên dùng để bào chế thuốc độc rồi, trong trường hợp nếu cần thiết chúng ta vẫn có thể hạ độc bọn chúng mà không cần sử dụng đến sức lực, hahaha\r\\n31@Con có thể thay ta làm nhiệm vụ này không?', '31@Tốt rồi, với số nguyên liệu này không những ta có thể bào chế ra loại thuốc cực độc mà còn chế ra cả được dược liệu để trị thương hiệu quả \\n31@Hãy mau giao nguyện liệu cho ta, rồi ta sẽ có phần thưởng', '', 90000000, 20, 0, 200000, '6@True@-1@2@0@0@', '[{\"id\":1,\"name\":\"Thu thập nọc bọ cạp\",\"idItem\":432,\"idNpc\":-1,\"idMob\":182,\"idMap\":76,\"x\":587,\"y\":402,\"require\":250,\"STR\":\"\",\"STR_ITEM\":\"\"},{\"id\":1,\"name\":\"Thu thập nấm độc\",\"idItem\":433,\"idNpc\":-1,\"idMob\":183,\"idMap\":73,\"x\":643,\"y\":459,\"require\":250,\"STR\":\"\",\"STR_ITEM\":\"\"}]');
